export default function SetNewItemData(props){

    return (
        <form id={props.id} onSubmit={props.handler} style={props.style}>
            <input name="date" type="date" value={props.date}/>
            <input name="title" type="title" value={props.title}/>
            <input name="cost" type="cost" value={props.cost}/>
            <input type="submit" value="ok" />
        </form>
    )
}
